import React from 'react';
import "./navbar.css";
import {NavLink} from 'react-router-dom';

function Navbar() {
  return (
    <div className='navbar'>
        <h1>BRIJAMOHAN JHA</h1>
        <ul>
            <li>
              <NavLink to = "/">Home</NavLink>
            </li>
            <li>About</li>
            <li>Projects</li>
            <li>Education</li>
        </ul>
    </div>
  )
}

export default Navbar
